import * as React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
  TextField,
  FormControlLabel,
} from "@mui/material";

const CheckoutForm = () => {
  return (
    <Box className="checkingForm">
      <Box className="form">
        <Typography
          gutterBottom
          variant="h6"
          component="div"
          className=""
          style={{
            paddingLeft: "3vw",
            paddingTop: "1vw",
            outline: "none",
            color: "black",
            font
          }}
        >
          CHECK OUT
        </Typography>
      </Box>
    </Box>
  );
};

export default CheckoutForm;
